  const productSceleton = (image, name, brand, category, price, description, rating) => {
    return  `
    <div class="product-card">
        <div class="image">
            <img width="350" height="350" src="${image}" alt="">
        </div>
        <div class="headers">
            <h2 class="product-title">${name.charAt(0).toUpperCase() + name.slice(1)}</h2>
            <h3 class="product-brand">${brand}</h3>
        </div>
        
        <div class="product-categories">
        <h5 class="heading">Categories</h5>
            ${category.map((c) => `<button>${c}</button>`)}
        </div>
        <div class="product-price">
        <h3 class="price"> Price: ${price}</h3>
        </div>
        <div class="product-description">
        <span>
        ${description}
        </span>
        </div>
        <div class="product-ratings">
        <h4>Rating: <span class="stars">${"★".repeat(rating)}</span></h4>
        </div>
    </div>`;
}

const renderProduct = (array, page = 1) => {
    container.innerHTML = "";
    const productsPerPage = 20;
    const totalPages = Math.ceil(array.length / productsPerPage);
    const start = (page - 1) * productsPerPage;
    const end = start + productsPerPage;

    if (array.length === 0) {
        container.innerHTML = "<h1>No Product found</h1>";
    } else {
        const productsToShow = array.slice(start, end);
        productsToShow.forEach(({id, image, rating, name, brand, price, category, description}) => {
            container.innerHTML += productSceleton(image, name, brand, category, price, description, rating);
        });
        renderPagination(totalPages, page);
    }
}

const renderPagination = (totalPages, currentPage) => {
    paginationContainer.innerHTML = "";
    for (let i = 1; i <= totalPages; i++) {
        const pageButton = document.createElement('button');
        pageButton.textContent = i;
        pageButton.classList.add('page-button');
        if (i === currentPage) {
            pageButton.classList.add('active');
        }
        pageButton.addEventListener('click', () => {
            renderProduct(products, i);
        });
        paginationContainer.appendChild(pageButton);
    }
    document.body.appendChild(paginationContainer); // Append pagination to the body
}

renderProduct(products);

search.addEventListener("input", (event) => {
    let term = event.target.value;
    if (term.length >= 2) {
        const searchByTerm = products.filter((product) => product.name.toLowerCase().includes(term.toLowerCase()));
        renderProduct(searchByTerm);
    } else {
        renderProduct(products);
    }
})

selectCategory.addEventListener("change", (e) => {
    let option = e.target.value;
    const filterByCategory = products.filter((product) => product.category.includes(option));
    renderProduct(filterByCategory);
})

selectPrice.addEventListener("change", (e) => {
    let option = e.target.value;
    let sortedProducts;
    if (option === "htl") {
        sortedProducts = [...products].sort((a, b) => parseFloat(b.price) - parseFloat(a.price));
    } else if (option === "lth") {
        sortedProducts = [...products].sort((a, b) => parseFloat(a.price) - parseFloat(b.price));
    } else {
        sortedProducts = [...products].sort((a, b) => b.rating - a.rating);
    }
    renderProduct(sortedProducts);
})

