passwordInput.addEventListener('input', () => {
    const password = passwordInput.value;
    passwordInput.setAttribute('data-password', password); 
    passwordInput.value = '*'.repeat(password.length); 
});

document.addEventListener('DOMContentLoaded', () => {
    const rangeInput = document.getElementById('range');
    const maxSpan = document.getElementById('max');
    const minSpan = document.getElementById('min');
    const productsContainer = document.querySelector('.container');

    maxSpan.textContent = 5000;
    minSpan.textContent = 0; 
    rangeInput.max = 5000;
    rangeInput.value = 5000;

    rangeInput.addEventListener('input', (e) => {
        const maxPrice = e.target.value;
        maxSpan.textContent = maxPrice;
        filterProductsByPrice(maxPrice);
    });

    function filterProductsByPrice(maxPrice) {
        const products = Array.from(productsContainer.children);
        products.forEach(product => {
            const price = parseInt(product.querySelector('.price').innerText.replace('Price: ', ''));
            if (price <= maxPrice) {
                product.style.display = 'block';
            } else {
                product.style.display = 'none';
            }
        });
    }
});
const addProductToCheckout = (product) => {
    const { name, price } = product;
    checkoutItems.innerHTML += `
    <div class="checkout-item">
        <span>${name}</span>
        <span>${price}</span>
    </div>`;
};

const handleProductClick = (event) => {
    if (event.target.closest('.product-card')) {
        const productName = event.target.closest('.product-card').dataset.id;
        const selectedProduct = products.find(p => p.name === productName);
        addProductToCheckout(selectedProduct);
        checkout.style.display = 'block';
    }
};

container.addEventListener('click', handleProductClick);

checkoutConfirm.addEventListener('click', () => {
    alert('Purchase confirmed!');
    checkoutItems.innerHTML = '';
    checkout.style.display = 'none';
});

checkoutCancel.addEventListener('click', () => {
    checkoutItems.innerHTML = '';
    checkout.style.display = 'none';
});
